CREATE TABLE "pokemon" 
(
    "id" INT PRIMARY KEY,
    "pokedex_id" INT NOT NULL,
    "name" VARCHAR(50) NOT NULL,
    "type_1" VARCHAR(50),
    "type_2" VARCHAR(50),
    "total" INT,
    "hp" INT,
    "attack" INT,
    "defense" INT,
    "sp_attack"	INT,
    "sp_defense" INT,
    "speed"	INT,
    "generation" INT NOT NULL
);

